import React from "react";
import { useLocation } from "react-router-dom";

function PageError() {
  const location = useLocation();

  const errorMessage = () => {
    if (location.state === undefined) {
      return "No errors !";
    } else {
      return location.state.detail;
    }
  };

  return (
    <div>
        {location.state}
    </div>

  );
}

export default PageError;
